import Button from "../component/Button";

const Home = () => {
    return (
        <div>
            <Button 
                text="button text" 
                onClick={() => {
                    alert("default button");
            }}/>
            <Button 
                text="button text" 
                onClick={() => {
                    alert("positive button");
            }}/>
            <Button 
                text="button text" 
                onClick={() => {
                    alert("negative button");
            }}/>
            
        </div>
    )
}

export default Home;
